script: |
  super -f text -I q4682.spq | sort > q4682.out

inputs:
  - name: q4682.spq
    data: |
      SELECT col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 81 * - - col0 + + - col1 - - + col2 * - col2 * - col0 NOT BETWEEN - col1 AND col1;
  - name: tab1

outputs:
  - name: q4682.out
    data: |
